CREATE TABLE countrywise_count(
id INT NOT NULL AUTO_INCREMENT,
country_id INT default null,
, mammals INTEGER
, birds INTEGER
, reptiles INTEGER
, amphibians INTEGER
, fishes INTEGER
, CONSTRAINT `CountrywiseCount_CountryId`
    FOREIGN KEY (country_id)
REFERENCES country (id)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
PRIMARY KEY (id)
);

